package com.forloop1;

public class DivisibleBy5 {
	
	public static void printnum(int num) {
		int i;
		for(i=1;i<=50;i++) {
			if(i%5==0)
				System.out.println(i);
		}
	}

	public static void main(String[] args) {
		int num = 0;
		// TODO Auto-generated method stub
		 printnum(num) ;
	}

}
